import{_ as d}from"./plugin-vue_export-helper.21dcd24c.js";import{o,c as l,a as n,w as s,b as e,d as a,e as h,r}from"./app.91508df4.js";const p={},k=e("h2",{id:"wix",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#wix","aria-hidden":"true",tabindex:"-1"},"#"),a(" Wix")],-1),c=e("h3",{id:"inleiding",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#inleiding","aria-hidden":"true",tabindex:"-1"},"#"),a(" Inleiding")],-1),g=e("p",null,"Cre\xEBer snel verzendetiketten van jouw Wix-orders en download deze vervolgens allemaal tegelijk vanuit het MyParcel-platform.",-1),m=e("p",null,"Let op! Wix Stores moet als App ge\xEFnstalleerd zijn op je webshop om een koppeling met MyParcel te kunnen maken.",-1),u=e("h3",{id:"installatie",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#installatie","aria-hidden":"true",tabindex:"-1"},"#"),a(" Installatie")],-1),x=e("h4",{id:"nieuwe-installatie",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#nieuwe-installatie","aria-hidden":"true",tabindex:"-1"},"#"),a(" Nieuwe installatie")],-1),v=e("p",null,[a("Om de koppeling te maken ga je naar "),e("code",null,"MyParcel > Integratie > Externe koppelingen > Wix"),a(". Klik op de knop 'Geef toestemming'.")],-1),b=e("p",null,"Vervolgens zal je naar Wix geleid worden. Als je nog niet ingelogd bent op Wix zal je dat alsnog moeten doen. Kies de shop die je wilt koppelen en druk op 'Add to Site' om de koppeling te maken.",-1),w=h('<h4 id="updaten-bestaande-installatie" tabindex="-1"><a class="header-anchor" href="#updaten-bestaande-installatie" aria-hidden="true" tabindex="-1">#</a> Updaten bestaande installatie</h4><p>Je hoeft een Wix koppeling nooit te updaten, dit wordt automatisch voor je gedaan.</p><h4 id="veelgestelde-vragen-over-de-installatie" tabindex="-1"><a class="header-anchor" href="#veelgestelde-vragen-over-de-installatie" aria-hidden="true" tabindex="-1">#</a> Veelgestelde vragen over de installatie</h4><h5 id="kan-ik-de-toestemming-om-myparcel-met-wix-te-koppelen-ook-weer-intrekken" tabindex="-1"><a class="header-anchor" href="#kan-ik-de-toestemming-om-myparcel-met-wix-te-koppelen-ook-weer-intrekken" aria-hidden="true" tabindex="-1">#</a> Kan ik de toestemming om MyParcel met Wix te koppelen ook weer intrekken?</h5><p>Het is zeker mogelijk om de koppeling tussen jouw Wix site en MyParcel ongedaan te maken. Klik hiervoor op de knop <code>Trek toestemming in</code> welke na de installatie zichtbaar wordt via <code>MyParcel &gt; Integratie &gt; Externe koppelingen &gt; Wix</code>. Omdat de MyParcel App niet automatisch verwijderd wordt van het Wix platform raden we je aan om onze App ook in Wix te verwijderen.</p><h3 id="configuratie" tabindex="-1"><a class="header-anchor" href="#configuratie" aria-hidden="true" tabindex="-1">#</a> Configuratie</h3><h4 id="pakketvoorkeuren" tabindex="-1"><a class="header-anchor" href="#pakketvoorkeuren" aria-hidden="true" tabindex="-1">#</a> Pakketvoorkeuren</h4><p>De Wix koppeling maakt gebruik van jouw standaard pakketvoorkeuren tijdens het importeren van de Wix orders. Ga naar <code>Account &gt; Shopinstellingen &gt; {jouw shopnaam} &gt; Zendingen</code>. Onder het kopje &#39;Pakketvoorkeuren&#39; heb je de mogelijkheid om een standaard pakkettype inclusief eventuele verzendopties te selecteren.</p><h3 id="veelgestelde-vragen-over-de-configuratie" tabindex="-1"><a class="header-anchor" href="#veelgestelde-vragen-over-de-configuratie" aria-hidden="true" tabindex="-1">#</a> Veelgestelde vragen over de configuratie</h3><h4 id="kan-ik-de-wix-koppeling-gebruiken-voor-orders-naar-alle-landen" tabindex="-1"><a class="header-anchor" href="#kan-ik-de-wix-koppeling-gebruiken-voor-orders-naar-alle-landen" aria-hidden="true" tabindex="-1">#</a> Kan ik de Wix koppeling gebruiken voor orders naar alle landen?</h4><p>Je kunt de Wix koppeling gebruiken voor orders naar Nederland en Europa. Zendingen naar de rest van de Wereld kunnen met PostNL als standaard vervoerder wel ge\xEFmporteerd worden, maar de douanegegevens zullen handmatig aangevuld moeten worden.</p><h4 id="kan-ik-bezorgopties-tonen-in-de-checkout-van-wix" tabindex="-1"><a class="header-anchor" href="#kan-ik-bezorgopties-tonen-in-de-checkout-van-wix" aria-hidden="true" tabindex="-1">#</a> Kan ik bezorgopties tonen in de checkout van Wix?</h4><p>Bezorgopties als afhalen en avondbezorging kunnen vanwege beperkingen op het Wix platform niet getoond worden in de checkout.</p><h3 id="plugin-gebruik" tabindex="-1"><a class="header-anchor" href="#plugin-gebruik" aria-hidden="true" tabindex="-1">#</a> Plugin gebruik</h3><h4 id="handmatig-aanmaken-van-een-of-meerdere-verzendlabels" tabindex="-1"><a class="header-anchor" href="#handmatig-aanmaken-van-een-of-meerdere-verzendlabels" aria-hidden="true" tabindex="-1">#</a> Handmatig aanmaken van \xE9\xE9n of meerdere verzendlabels</h4><p>Na de installatie van de Wix koppeling zal de knop <code>Importeer externe orders</code> zichtbaar zijn in het zendingenoverzicht. Klik hier op om jouw openstaande orders in Wix te bekijken. Hier worden alleen maar orders getoond die in Wix de status &#39;Paid&#39; of Betaald&#39; hebben. Mocht je meerdere externe koppelingen hebben ge\xEFnstalleerd dan kan je tussen de verschillende tabjes schakelen. Op deze pagina heb je de mogelijkheid om order per stuk of in bulk te importeren.</p><p>Als je in Wix de &#39;Shipping confirmation&#39; e-mail geactiveerd hebt zal er een e-mail gestuurd worden met Track &amp; Trace informatie. Ook wordt in Wix de status van de zending bijgewerkt.</p><h4 id="aanpassen-van-een-enkele-zending" tabindex="-1"><a class="header-anchor" href="#aanpassen-van-een-enkele-zending" aria-hidden="true" tabindex="-1">#</a> Aanpassen van een enkele zending</h4><p>Ge\xEFmporteerde orders worden als conceptzending aangemaakt. Klik op <code>bewerk MyParcel conceptzending</code> achter de zending om deze te bewerken.</p><h3 id="veelgestelde-vragen" tabindex="-1"><a class="header-anchor" href="#veelgestelde-vragen" aria-hidden="true" tabindex="-1">#</a> Veelgestelde vragen</h3><h4 id="waarom-zie-ik-mijn-wix-order-niet-in-myparcel" tabindex="-1"><a class="header-anchor" href="#waarom-zie-ik-mijn-wix-order-niet-in-myparcel" aria-hidden="true" tabindex="-1">#</a> Waarom zie ik mijn Wix order niet in MyParcel?</h4><p>Controleer de status van de order in Wix. Alleen orders met de status &#39;Paid&#39; of &#39;Betaald&#39; kunnen ge\xEFmporteerd worden.</p><h4 id="kan-ik-voor-het-importeren-per-order-een-pakketvoorkeur-meegeven" tabindex="-1"><a class="header-anchor" href="#kan-ik-voor-het-importeren-per-order-een-pakketvoorkeur-meegeven" aria-hidden="true" tabindex="-1">#</a> Kan ik voor het importeren per order een pakketvoorkeur meegeven?</h4><p>Nee, het is niet mogelijk om voor het importeren de pakketvoorkeuren per order aan te passen. Voor elke import zullen de standaard pakketvoorkeuren gebruikt worden.</p>',24);function f(j,z){const t=r("Message"),i=r("MPImg");return o(),l("div",null,[k,c,g,n(t,{title:"",type:"note"},{default:s(()=>[m]),_:1}),u,x,v,n(i,{src:"/documentation/wix/wix-myparcel-backoffice.jpg",alt:"Wix backoffice"}),b,n(i,{src:"/documentation/wix/wix-authenticatie.jpg",alt:"Wix authentication"}),w])}var P=d(p,[["render",f],["__file","20.wix.html.vue"]]);export{P as default};
